import React, { Component } from "react";
import axios from "axios";
import {Button} from 'react-bootstrap';
import "./Signup.css";


class Signup extends Component {
  constructor(props) {
    super(props);
    this.state = {
      passwordMatch: true,
      passwordLength: true,
      firstName: "",
      lastName: "",
      userEmail: "",
      userRole: "",
      password: "",
      confirmPassword: "",
      status: "xyz",
    };
  }
  handleChange=(event)=> {
    this.setState({ [event.target.name]: event.target.value });
  }
  

  render() {
    return (
        <form onSubmit={this.handleSubmit} className="signup-form-fields">
          

            <div className="signup-heading">Sign Up</div>
        
        
        <div className="form-row-grid" >
            <div className="form-label-input-grid">
            <label>First Name</label>
              
              <input className="signup-textbox"
                         required
                         type="text"
                         name="firstName"
                         value={this.state.firstName}
                         onChange={this.handleChange}/>
                 
                 
               

            </div>
            <div className="form-label-input-grid">
                 <label>Second Name</label>
                 <input className="number-of-participents-textbox"
                         required
                         type="text"
                         name="lastName"
                         value={this.state.lastName}
                         onChange={this.handleChange}/>
            </div>
        </div>

            <div className="form-label-input-grid">
                 <label>Email</label>
 
                     <input className="signUp-textbox"
                         required
                         type="Paswo"
                         name="roomPasscode"
                         value={this.state.roomPasscode}
                         onChange={this.handleChange}/>
                   
            </div>
            <div className="form-label-input-grid">
                 <label>Email</label>
                 <input className="signUp-textbox"
                         required
                         type="Email"
                         name="rules"
                         value={this.state.rules}
                         onChange={this.handleChange}/>        
            </div>
        
        <Button  className="signup-button"
             type="submit"
             > Create Room</Button>
            
 </form>
    );
  }
}
export default Signup;
